//dada una cantidad de lineas por pagina para mostrar y la cantidad de registros
// nos devuelve la cantidad de paginas necesarias
let calcuPaginator = (lineas,cantReg) => {
    if(lineas>=cantReg) return 1;
    else return Math.ceil(cantReg/lineas);
}

// BottonsPaginator :dada la celda activa y la cantidad de paginas
// nos devolvera un array donde cada uno de los elementos sera un boton del paginador
function bottonsPaginator(active,cantPags){
    let bot = [],i ;
    const maxView = 10;

    //Si la cantidad de pag es menor a 10
    if(cantPags<=maxView){
        for (i = 1; i <=cantPags; i++) { bot.push(`${i}`) }
        return bot;
    }
    
    bot.push("<"); 
    
    //cuantos mostramos al rededor del numero activo EJ activo=5   Show=2 -> 3 4 5 6 7 
    const ShowPredef=2;

    // funciona cuando el activo esta a menos de tres pasos del primero.
    // Necesario para que suceda esto -> act =4  1 2 3 4 5 6 y no 1 ... 2 3 4 5 6 
    if(active-ShowPredef<=3) {
        for (i = 1; i <=(active+ShowPredef); i++) { bot.push(`${i}`)}
        bot.push(dots);
        for (i = (cantPags-ShowPredef); i <=cantPags; i++) { bot.push(`${i}`)}
    }

    // funciona cuando el activo esta a menos de tres pasos del ultimo. 
    // Necesario para que suceda esto -> act =7  1 ... 5 6 7 8 9 10 11 y no 1 ... 5 6 7 8 9 ... 11
    else if((cantPags-ShowPredef)-active<3) {
        for (i = 1; i <=ShowPredef; i++) { bot.push(`${i}`)}
        bot.push(dots);
        for (i = (active-ShowPredef); i <=cantPags; i++) { bot.push(`${i}`)}
    }
    
    //funciona cuando la pag activa esta "en el medio de los extremos"
    else {
        bot.push(`${1}`)
        bot.push(dots);
        for (i = (active-ShowPredef); i <=(active+ShowPredef); i++) { bot.push(`${i}`)}
        bot.push(dots);
        bot.push(`${cantPags}`)
    }

    bot.push(">"); 

    return bot;
}


//dado un array donde cada elemento representa a un boton y el id del div del Paginador
// rellena el div con todos los botones del array
function paginator(buttons,divBot = "keypad"){
    let div =document.getElementById(divBot), but,parr;
    div.innerHTML='';

    buttons.forEach(element => {
        //si el elemento son los puntos no queremos que sea un boton 
        if (element==dots){
            parr  = document.createElement('p');
            parr.innerText= element;
            div.appendChild(parr);

        }
        // genera un boton con valor y dentro el elemento
        else{
            but  = document.createElement('button');
            but.className="button";
            but.value = `${element}` ;
            but.innerText=  `${element}`;
            div.appendChild(but);
        }
    });
    
}

//ingresando el valor del boton presionado la cant max de paginas y la pagina activa 
//nos devuelve la pagina a la que deveria ir
function buttonAccion(input,maxView,activ) {
    //si presiona < va una pagina hacia atras excepto si es la primera
    if(input=='<' ) {
        if(activ!=1) {return activ-1}
        else {return activ};
    }
    //si presiona > va una pagina hacia adelante excepto si es la ultima
    else if(input=='>'){
        if(activ!=maxView) {return activ+1;}
        else {return activ};
    }
    //sino devuelve el numero de la pag
    else return parseInt(input);
    
}



const whenClicked = function (evento) {
    active = buttonAccion(this.innerText,maxView,active);
    paginator(bottonsPaginator(active,maxView),'keypad');
    botones = document.querySelectorAll(".button");
    eventCLick();
    emptyTable(idtab);
    tableFill(json,lines,active,maxView,arrInit);
  
}

function eventCLick() {
    botones.forEach(boton => {
        boton.addEventListener("click", whenClicked);
    });
}

